package com.comit.course.operator;

class Arithmatic {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a=8;
		int b=3;
	     int c=a/b;//dfdf
		System.out.println("a/b="+ c);
		
		boolean equalto    = a == b;
		boolean notequal   = a != b;
		boolean greater    = a > b;
		boolean lessthan   = a < b;
		
		int a1=++a;
		System.out.println(a1);
		/*
		 * sfs
		 * sdfsfs
		 * sf
		 * */
		
	}

}
